import { BowserRouter, Routes, Route } from "react-router-dom";

//pages and components
import Home from "./pages/Home";

function App() {
  return (
    <>
      <div className="App">
        <BowserRouter>
          <div className="pages">
            <Routes>
              <Route 
                path='/'
                element = {<Home />}
              />
            </Routes>
          </div>
        </BowserRouter>
      </div>
    </>
  );
}

export default App;
